import { Link } from 'react-router-dom';

function MovieCard({ title, id }) {
  return (
    <>
      <p>{title}</p>
      <button className="movie-button">
        <Link to={`/movie/${id}`}>View Info</Link>
      </button>
    </>
  );
}

export default MovieCard;
